def subtract_vectors(u, v):

    if len(u) != len(v):
        raise ValueError("Vectors must have the same length.")
    result = [u[i] - v[i] for i in range(len(u))]
    return result

def dot_product(u, v):

    if len(u) != len(v):
        raise ValueError("Vectors must have the same length.")
    result = sum([u[i] * v[i] for i in range(len(u))])
    return result
